// solution 4
const productExceptSelf = function (nums) {
  const n = nums.length;
  let left = new Array(n).fill(1);
  let right = new Array(n).fill(1);
  let result = [];
  for (let i = 1; i < n; i++) {
    left[i] = nums[i - 1] * left[i - 1];
  }

  for (let i = n - 1; i > 0; i--) {
    right[i - 1] = nums[i] * right[i];
  }

  for (let i = 0; i < n; i++) {
    result[i] = left[i] * right[i];
  }

  return result;
};

